package main

import (
	"fmt"
	"strings"
)

func main() {
	banner("Go", 6)

	fmt.Printf("%v", isPalindrome("hannah"))
	fmt.Println()
	fmt.Printf("%v", isPalindrome("socorram me subi no onibus em marrocos"))
	fmt.Println()
	fmt.Printf("%v", isPalindrome("g"))
	fmt.Println()
	fmt.Printf("%v", isPalindrome("gog"))
	fmt.Println()
	fmt.Printf("%v", isPalindrome("œgœ"))
	fmt.Println()
	fmt.Printf("%v", isPalindrome("gogo"))
	fmt.Println()
	fmt.Printf("%v", isPalindrome(""))

}

func isPalindrome(s string) bool {
	noSpaces := strings.ReplaceAll(s, " ", "")

	rns := []rune(noSpaces)

	for i := 0; i < len(rns)/2; i++ {
		if rns[i] != rns[len(rns)-i-1] {
			return false
		}
	}

	return true
}

func banner(text string, width int) {
	padding := (width - len(text)) / 2

	for i := 0; i < padding; i++ {
		fmt.Print(" ")
	}

	fmt.Println(text)

	for i := 0; i < width; i++ {
		fmt.Print("-")
	}
	fmt.Println()

}
